[{"operationName":"membershipQuery","variables":{"userId":"20430477"},"query":"query membershipQuery($userId: String!) {
  ProgramMembershipsV2Resource {
    byUser(userId: $userId) {
      elements {
        id
        enterpriseProgram {
          id
          thirdPartyOrganizationId
          browsingExperience {
            id
            browsingExperience
            __typename
          }
          metadata {
            slug
            name
            description
            endedAt
            launchedAt
            curriculumId
            __typename
          }
          __typename
        }
        membershipState
        programId
        createdAt
        userId
        __typename
      }
      __typename
    }
    __typename
  }
  DegreeLearnerMembershipsV1Resource {
    byUser(userId: $userId) {
      elements {
        id
        createdAt
        degreeId
        role
        degree {
          id
          name
          slug
          internalLaunchType
          supportEmailAddress
          partnerIds
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  ProgramSwitcherSelectionsV1Resource {
    get(id: $userId) {
      id
      selectionType
      programId
      degreeId
      __typename
    }
    __typename
  }
}
"},{"operationName":null,"variables":{"ids":["20430477"]},"query":"query ($ids: [String!]!) {
  UserVerificationRequirementsV1Resource {
    multiGet(ids: $ids) {
      elements {
        userVerificationRequirementState
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"ProgramMembershipsV1Query","variables":{"userId":"20430477"},"query":"query ProgramMembershipsV1Query($userId: String!) {
  ProgramMembershipsV1Resource {
    byUser(userId: $userId) {
      elements {
        id
        userId
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
